import React, { Component } from "react";
import "./style.css";
import InIcon from "./assets/bill-stack.png";

class InCard extends Component {
    render() {
        return (
            <div>
                <div class="card">
                <img class="responsive-img" style={{width: 50 , marginLeft:20 ,marginTop:30 }} src={InIcon}></img>
                    <h4 class="flow-text">Money Inbox</h4>
                    <div class="card-content">
                        <div class="positive" class="flow-text">+$56</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default InCard;
